import axios from 'axios';
import './App.css';

class App extends Component {
componentDidMount(){
  axios.get("")
  then((response) =>{
    console.log(response);
    this.setState({region:response.data})
})
.catch((error) =>{
  console.log(error);

});

}


  render(){  
  return (
   <div className="App">
     <div className="form-group">
<select name="region" className="form-control">
  {this.state.region.map(elemento=>(

    <option key="{elemento.id}" value={elemento.id}>{elemento.nombre}</option>
  ))}
</select>

     </div>
   </div>
  )
}
}


export default App;
